import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div>
      <Link to={"/"}>Home</Link>
      <Link to={"/snake"}>Snake</Link>
      <Link to={"/minesweeper"}>MineSweeper</Link>
    </div>
  );
}

export default Header;
